import React from 'react';
import styled from 'styled-components';

const DividerWBlock = styled.div`
  display: flex;
  flex-direction: column;
  color: black;
  background-color: #fdfdfd;
  text-align: center;
  padding-top: 36px;
  padding-bottom: 43px;
`;

const DividerWBlockColumn = styled.p`
  font-size: 30px;
  &:first-child {
    text-emphasis: filled sesame;
    -webkit-text-emphasis: filled white;
    font-size: 40px;
  }
`;

const DividerW = () => (
  <DividerWBlock>
    <DividerWBlockColumn>
      이론만 공부하고 끝나는 단순한 인터넷 강의가 아닌
    </DividerWBlockColumn>
    <br />
    <DividerWBlockColumn>
      코더스하이 실시간 원격 코스는 다릅니다
    </DividerWBlockColumn>
  </DividerWBlock>
);

export default DividerW;
